function processType(type: TypeSystemValue): string {
  switch (type.type) {
    case 'string':
      return `string${type.modifiers.optional ? '?' : ''}`;
    case 'array':
      return `${processType(type.items)}[]`;
    case 'object':
      return 'object';
    case 'ref':
      return type.name;
    default:
      return type.type;
  }
