Next.js dynamic route generation
```typescript
class NextJsRouteGenerator {
  generateFileStructure(openApiPaths: string[]) {
    return openApiPaths.map(path => {
      // Convert to Next.js file-based routing syntax
      const routerPath = toPathParams(path);
      const fileName = routerPath
        .replace(/:/g, '[') // :id becomes [id
        .replace(/\/\[([^\]]+)/g, '/[$1]') // [id becomes [id]
        .replace(/^\//,'') // Remove leading slash
        + '.tsx';

      return {
        originalPath: path,
        routerPath,
        fileName
      };
    });
  }
}

const generator = new NextJsRouteGenerator();
const structure = generator.generateFileStructure([
  '/users/{id}',
  '/posts/{slug}/comments/{commentId}'
]);

console.log(structure);
// [
//   {
//     originalPath: '/users/{id}',
